"use strict";
module.exports = /*#__PURE__*/JSON.parse('{"schema":{"id":"string","order":"number","slug":"string","title":"string","summary":"string","narrative":["string"],"examples":["string"],"why_matters":["string"],"instead_of_asking":["string"]},"principles":[{"id":"p01","order":1,"slug":"ux-fits-process","title":"UX Should Fit the Process, Not Disrupt It","summary":"UX is most effective when it is seamlessly integrated into existing workflows, rather than treated as a rigid, stand-alone phase. When UX is introduced as a separate, highly structured process, it often creates friction, not because UX itself is unimportant, but because it feels like an extra burden rather than a natural part of product development.\\n\\nRather than insisting on a pre-defined UX framework, Pragmatic UX Design adapts to the realities of each team and organisation. But UX should not just fit the process, it should enhance it. Pragmatic UX Design ensures that UX fits seamlessly into workflows, while identifying areas where processes themselves could be improved to support better user experiences.","narrative":[],"examples":["Agile Development: Instead of requiring extensive research phases before development starts, integrate lightweight research into ongoing sprints (e.g., quick usability tests or user feedback loops).","Engineering-Driven Teams: If technical feasibility heavily influences product decisions, UX should provide practical, development-friendly solutions instead of designing in isolation.","Fast-Paced Startups: If speed is critical, prioritise rapid prototyping and quick validation methods rather than long discovery phases."],"why_matters":["Reduces resistance to UX: When UX aligns with existing processes, teams are more likely to adopt it.","Improves efficiency: UX shouldn\'t slow development down; it should enhance it.","Ensures real impact: When UX fits naturally into workflows, it is applied more consistently across the product."],"instead_of_asking":["How can UX contribute effectively without adding unnecessary complexity?","What UX methods work best within the team\'s existing workflow?"]},{"id":"p02","order":2,"slug":"efficiency-over-delight","title":"Users Value Efficiency Over Unnecessary Delight","summary":"Pragmatic UX Design prioritises usability and efficiency over decoration, with aesthetics serving clarity and speed. Most users prioritise speed and efficiency over aesthetics. A well-designed interface is delightful by being intuitive and frictionless.\\n\\nPragmatic UX Design prioritises usability as the foundation of a great experience. Aesthetics and delight can enhance a product, but they should never come at the expense of clarity, speed and ease of use, because efficiency is what makes a product truly enjoyable. Great visual design and subtle interactions can enhance a seamless experience, but they should always serve usability, not replace it.","narrative":[],"examples":["E-Commerce: Instead of flashy animations, streamline the checkout flow to minimise steps and reduce friction.","Mobile Apps: Instead of overloading the interface with microinteractions, focus on fast-loading screens and intuitive navigation.","B2B Software: Instead of prioritising a polished UI refresh, simplify complex workflows so users can complete tasks with minimal effort."],"why_matters":["Boosts user satisfaction: People prefer speed and efficiency over decorative elements.","Reduces unnecessary complexity: More animations and interactions don\'t always improve usability.","Increases task completion rates: The best experience is one that helps users reach their goal faster."],"instead_of_asking":["How can we make this as easy and fast as possible?","What\'s the simplest way to help users complete their tasks?"]},{"id":"p03","order":3,"slug":"empower-dont-overcomplicate","title":"UX Should Empower, Not Overcomplicate","summary":"Pragmatic UX Design removes overhead and empowers teams with clear, actionable insights instead of complex processes. UX is about simplifying, clarifying and improving products. But when UX is presented as a rigid, highly structured process, it can create resistance instead of engagement. Teams may start to see UX as a slow-moving layer of documentation rather than a valuable decision-making tool.\\n\\nPragmatic UX Design removes unnecessary overhead while ensuring that UX remains a strategic force in decision making. UX should not be reduced to a set of deliverables, it should actively empower teams with insights that drive better, faster decisions.\\n\\nUX isn\'t just about reacting to existing problems; it\'s about embedding user-centred thinking into the workflow at an early stage, preventing problems before they arise.","narrative":[],"examples":["Stakeholders Who Need Quick Decisions: Instead of presenting a 50-slide UX report, summarise findings in a concise, one-page actionable list.","Developers Seeking Clear Direction: Instead of delivering overly detailed wireframes, provide quick sketches that can be iterated based on feedback.","Cross-Functional Teams Needing Input: Instead of lengthy UX documentation, offer short, digestible insights that enable immediate action."],"why_matters":["Increases adoption of UX insights: If UX is easy to digest, stakeholders actually use it.","Accelerates decision-making: Lightweight documentation means faster action.","Strengthens collaboration across teams: When UX is clear and actionable, it naturally integrates into workflows."],"instead_of_asking":["How can we deliver UX insights in the simplest, most actionable way?","What\'s the minimum amount of documentation needed to drive change?"]},{"id":"p04","order":4,"slug":"execution-over-theory","title":"Theory Is Nice, but Execution Wins","summary":"Frameworks provide structure, but success comes from adapting them to real-world constraints and executing effectively. UX methodologies such as the Double Diamond, Design Thinking, or Human-Centred Design look great in presentations, but they often fall apart in the real-world of product development. Teams work under tight deadlines, shifting priorities, and business constraints, which means that a rigid, textbook approach to UX is rarely practical.\\n\\nPragmatic UX Design recognises that frameworks provide structure, but real success comes from knowing when to adapt and streamline them. UX is most valuable when it balances best practice with real-world constraints, applying the right methods at the right time. The goal is not to execute the \\"perfect\\" UX process, but to ensure that users get a better experience, without unnecessary complexity.\\n\\nUX methodologies are not rules to be rigidly followed, but flexible tools that should be tailored to the specific needs of a project.","narrative":[],"examples":["Product Teams Under Pressure: Instead of insisting on a full Design Thinking workshop, run a condensed session focused on immediate problem-solving.","Stakeholders Wanting Results Fast: If leadership needs quick wins, prioritise a rapid usability audit over lengthy user interviews.","MVP Development: Instead of spending weeks perfecting personas, use quick assumptions and validate them with real users post-launch."],"why_matters":["Prevents UX from being sidelined: When UX is practical, teams actually use it.","Avoids wasted effort: The goal is to improve usability, not complete theoretical frameworks.","Fits real-world constraints: UX should adapt to time, budget, and business limitations."],"instead_of_asking":["What\'s the most useful part of UX for this specific project?","How can we apply UX efficiently instead of perfectly?"]},{"id":"p05","order":5,"slug":"right-sized-research","title":"Research Should Be Right-Sized for the Context","summary":"Pragmatic UX Design matches research depth to context, ensuring insights are fast and useful without slowing progress. One of the biggest myths in UX is that good research requires big budgets and long timelines. While deep, comprehensive studies can provide valuable insights, they are not always necessary, especially when fast decisions need to be made quickly.\\n\\nPragmatic UX Design ensures that research is right-sized for the context, delivering meaningful insights in the most efficient way possible. Some situations require rapid testing, while others justify deeper exploration. The key is to match the research method to the decision at hand.\\n\\nWhile quick, lightweight research works well for iterative improvements, more complex or high-stakes products may require deeper investigation to ensure long-term success.\\n\\nInstead of delaying progress for the \\"perfect\\" research phase, teams can gather meaningful user insights quickly and iterate continuously.","narrative":[],"examples":["Small Teams Without Research Budgets: Instead of hiring external agencies, talk to 5 real users and observe their behavior.","Fast-Moving Startups: Instead of conducting long surveys, run quick in-product feedback sessions.","Agile Environments: Instead of pausing sprints for formal studies, integrate usability testing into ongoing iterations."],"why_matters":["Makes UX insights accessible: No need for a large research budget to make informed decisions.","Speeds up decision-making: Quick feedback loops ensure continuous learning.","Prevents research paralysis: Teams focus on learning and applying insights, not just collecting data."],"instead_of_asking":["What\'s the fastest way to validate our assumptions?","How can we gather useful insights with minimal effort?"]},{"id":"p06","order":6,"slug":"scale-to-needs","title":"UX Should Be Scaled to Fit the Product\'s Needs","summary":"UX is always relevant, but the depth of involvement should scale with product complexity, risk, and goals. UX is not a one-size-fits-all approach. Some projects require deep UX involvement, while others benefit from leaner, faster iterations. Applying the same level of UX rigor to every project can lead to wasted resources, unnecessary complexity, and slower decision-making.\\n\\nPragmatic UX Design ensures that UX is always present, but at the right level of depth. Every product benefits from UX thinking, but the approach should be tailored to match its complexity, risks, and business goals.\\n\\nSkipping UX altogether is rarely the right approach, rather, it should be integrated in a way that maximises impact while respecting constraints.","narrative":[],"examples":["Internal Tools for Employees: Instead of a full UX research phase, apply UX best practices and refine based on direct user feedback.","High-Risk Products (e.g., Healthcare Apps): Here, extensive UX work is critical because mistakes can have serious consequences.","MVP Development: For early-stage products, focus on core usability before refining micro-details."],"why_matters":["Saves time and resources: Not all projects need deep UX work.","Prevents unnecessary complexity: UX should match the importance and scale of the product.","Keeps teams focused: Effort goes where it\'s needed most, ensuring maximum impact with minimal overhead."],"instead_of_asking":["What level of UX involvement makes sense for this project?","Where can UX create the most impact with minimal effort?"]},{"id":"p07","order":7,"slug":"iterate-with-purpose","title":"Iterate with Purpose","summary":"Iteration should always be focused, data-driven, and purposeful, not endless tweaking. Iteration is a fundamental part of UX, but iterating without direction leads to wasted effort. Refining details endlessly doesn\'t guarantee a better user experience, focused, purposeful changes does. \\n\\nPragmatic UX Design ensures that iteration is always purposeful, driven by data, user feedback, and measurable impact. Iteration is not about achieving perfection, but about making continuous, meaningful improvements that enhance usability and product performance.\\n\\nUnstructured iteration can waste resources, but well-planned iteration, based on real user behaviour, ensures continuous refinement without unnecessary complexity.","narrative":[],"examples":["Usability Testing Refinement: Instead of reworking an entire UI, focus on the 2–3 interactions where users struggle the most.","Conversion Rate Optimisation: Instead of A/B testing everything, prioritise elements that historically impact user behavior (e.g., CTA buttons, form length, loading speed).","Content Adjustments: Instead of rewriting all help documentation, analyse support tickets and FAQs to identify and improve the most confusing sections."],"why_matters":["Prevents unnecessary design churn: Every iteration serves a clear purpose.","Saves time: Focused improvements are faster and easier to implement.","Ensures measurable improvements: Testing and iteration align with key success metrics."],"instead_of_asking":["What\'s the most impactful improvement we can test right now?","How can we iterate efficiently without overcomplicating the process?"]},{"id":"p08","order":8,"slug":"reuse-design-systems","title":"Work Smarter: Reuse Design Systems and Best Practices","summary":"UX design doesn\'t have to start from scratch every time. Many design challenges have already been solved through design systems, reusable UI components, and established best practices. These resources help streamline development, ensure consistency, and eliminate redundant work.\\n\\nInstead of designing everything from scratch, Pragmatic UX Design strategically leverages existing resources, not only to save time, but to improve usability, maintain consistency, and ensure accessibility. The key is to balance efficiency with thoughtful customisation, ensuring that existing solutions are adapted to meet specific user needs.\\n\\nFor teams managing multiple products, the use of design systems ensures scalability and a consistent experience across platforms.","narrative":["UX design doesn\'t have to start from scratch every time. Many design challenges have already been solved through design systems, reusable UI components, and established best practices. These resources help streamline development, ensure consistency, and eliminate redundant work.","Instead of designing everything from scratch, Pragmatic UX Design strategically leverages existing resources, not only to save time, but to improve usability, maintain consistency, and ensure accessibility. The key is to balance efficiency with thoughtful customisation, ensuring that existing solutions are adapted to meet specific user needs.","For teams managing multiple products, the use of design systems ensures scalability and a consistent experience across platforms."],"examples":["Design Systems: Systems like Material Design, Apple\'s Human Interface Guidelines, or company-specific UI kits provide ready-to-use principles that ensure usability and scalability.","Component Libraries: UI frameworks like Bootstrap, Tailwind, or Figma libraries offer pre-built elements that reduce development time and maintain design consistency.","Industry Best Practices: Standard UX patterns, like breadcrumbs for navigation, common form validation rules, or error messaging guidelines, prevent usability issues before they arise."],"why_matters":["Faster execution: Leveraging existing resources accelerates workflows and reduces design debt.","Consistency across platforms: Standardised elements create familiar and predictable user experiences.","Less redundant work: Teams avoid solving the same UX problems repeatedly, allowing more focus on innovation."],"instead_of_asking":["Is there an existing UI component we can use?","Does a design system already provide a tested solution?"]}]}');

